jQuery(document).ready(function(){jQuery("a").each(function(){var n=jQuery(this);var m=n.attr("href");if(m==undefined){return}var l=m.replace("http://","").replace("https://","");var a=m.split(".").reverse();var i=a[0].toLowerCase();var a=m.split("/").reverse();var j=a[2];var k=false;if(jQuery.inArray(i,analyticsFileTypes)!=-1){k=true;n.click(function(){if(analyticsEventTracking=="enabled"){_gaq.push(["_trackEvent","Downloads",i.toUpperCase(),m])}else{_gaq.push(["_trackPageview",analyticsDownloadsPrefix+l])}})}if((m.match(/^http/))&&(!m.match(document.domain))&&(k==false)){n.click(function(){if(analyticsEventTracking=="enabled"){_gaq.push(["_trackEvent","Outbound Traffic",m.match(/:\/\/(.[^/]+)/)[1],m])}else{_gaq.push(["_trackPageview",analyticsOutboundPrefix+l])}})}})});